e Versandtarife an, die auf der von Google Distance Matrix API berechneten Entfernung oder Gesamtreisezeit basieren, und überzahle für den Versand nicht mehr.','Flexible Shipping Locations'=>'Flexible Shipping Standorte','Calculate the shipping cost based on location. Define your own custom locations, use the WooCommerce defaults or the ones created by 3rd party plugins.'=>'Berechne die Versandkosten basierend auf dem Standort. Bestätige deine eigenen benutzerdefinierten Standorte, verwende die WooCommerce-Standardwerte oder die von Drittanbieter-Plugins erstellten Standorten.','Flexible Printing'=>'Flexibler Druck','Automate your shipping process. Print the shipping labels on thermal printers via PrintNode service. Let the labels be printed automatically the same time the order is placed.'=>'Automatisiere deinen Versandprozess. Drucke die Versandetiketten auf Thermodruckern über den PrintNode-Service. Lass die Versandetiketten automatisch drucken, wenn die Bestellung aufgegeben wird.','Flexible Shipping Import / Export'=>'Flexible Shipping Import / Export','Use the CSV files to import or export your shipping methods. Edit, update, move or backup the ready configurations and shipping scenarios.'=>'Verwende die CSV-Dateien, um deine Versandmethoden zu importieren oder zu exportieren. Bearbeite, aktualisiere, verschiebe oder sichere die fertigen Konfigurationen und Versandszenarien.','DHL Express Live Rates PRO'=>'DHL Express WooCommerce Live-Versandtarife PRO','WooCommerce DHL Express integration packed with many advanced features. Display the dynamically calculated live rates for DHL Express shipping methods and adjust them to your needs.'=>'WooCommerce DHL Express Integration verpackt mit vielen erweiterten Funktionen. Zeige die dynamisch berechneten Live-Tarife für DHL Express-Versandmethoden an und passe sie an deine Bedürfnisse an.','Multi Vendor Shipping'=>'Multi Vendor Versand','Define precisely the shipping cost calculation rules for each Vendor / Product Author in your marketplace or multivendor store.'=>'Definiere genau die Regeln zur Berechnung der Versandkosten für jeden Verkäufer / Produktautor auf deinem Marktplatz oder Multivendor-Shop.','Shipping Packages'=>'Versandpakete','Split the WooCommerce cart content into multiple packages based on various conditions like shipping class.'=>'Teile den Inhalt des WooCommerce-Warenkorbs in mehrere Pakete auf, die auf verschiedenen Bedingungen wie der Versandklasse basieren.','Conditional Shipping Methods'=>'Bedingte Versandmethoden','Conditionally display and hide the shipping methods in your WooCommerce store. Define the rules when the specific shipping methods, e.g., live rates should be available to pick and when not to.'=>'Bedinge das Ein-und-Ausblenden der Versandmethoden in deinem WooCommerce-Shop. Definiere die Regeln, wann die spezifischen Versandmethoden, z. B. Live-Tarife, zur Auswahl verfügbar sein sollen und wann nicht.','Delivery Date Picker'=>'Lieferterminwähler','Let your customers choose a convenient delivery date for the ordered products and make the shipping cost dependent on the date they choose.'=>'Lass deine Kunden ein günstiges Lieferdatum für die bestellten Produkte wählen und mache die Versandkosten von dem gewählten Datum abhängig.','USPS Live Rates PRO'=>'USPS WooCommerce Live-Versandtarife PRO','Serve your customers the automatically and real-time calculated USPS shipping rates. Add the handling fees, insurance and adjust them to your needs with just a few clicks.'=>'Biete deinen Kunden die automatisch und in Echtzeit berechneten USPS-Versandtarife an. Füge die Bearbeitungsgebühren und die Versicherung hinzu und passe sie mit nur wenigen Klicks an deine Bedürfnisse an.','Shipping Cost on Product Page PRO'=>'Rechner der Versandkosten auf der Produktseite PRO','Let your customers calculate and see the shipping cost on product pages based on the entered shipping destination and cart contents. Decide how and when exactly you want the shipping cost calculator to display.'=>'Lass deine Kunden die Versandkosten auf den Produktseiten berechnen und anzeigen, basierend auf dem eingegebenen Versandziel und dem Inhalt des Warenkorbs. Entscheide wie und wann genau du den Versandkostenrechner anzeigen lassen möchtest.','DPD UK & DPD Local'=>'DPD UK & DPD Local','Ship your DPD orders faster with advanced DPD UK & DPD Local WooCommerce integration. Gather shipping details, download printable shipping labels and track parcels - everything is automated.'=>'Versende deine DPD Bestellungen schneller mit der erweiterten DPD UK & DPD Local WooCommerce Integration. Sammele die Versanddetails, lade die druckbare Versandetiketten herunter und verfolge Pakete - alles ist automatisiert.','All'=>'Alle','Live Rates'=>'Live-Versandtarife','Customizable Rates'=>'Benutzerdefinierter Versandtarif','Shipping Labels'=>'Versandetiketten','Link on plugin list pageExtensions'=>'Erweiterungen','Shipping Extensions by'=>'Versanderweiterungen von','Dive into a system of Octolize ecommerce shipping plugins for WooCommerce. Don’t lose your customers, time and money. Let our plugins secure your sales!'=>'Tauche ein in ein System von Octolize E-Commerce Versand Plugins für WooCommerce. Verliere keine Kunden, Zeit und kein Geld. Lass unsere Plugins deinen Umsatz sichern!','Filter plugins:'=>'Filter Plugins nach:','Buy plugin →'=>'Plugin kaufen →','Blackout Lead Days'=>'Ausschluss von Durchführungstagen','Blackout Lead Days are used to define days of the week when shop is not processing orders.'=>'Diese Option wird verwendet, um Tage in der Woche zu definieren, an denen der Shop keine Bestellungen bearbeitet.','Monday'=>'Montag','Tuesday'=>'Dienstag','Wednesday'=>'Mittwoch','Thursday'=>'Donnerstag','Friday'=>'Freitag','Saturday'=>'Samstag','Sunday'=>'Sonntag','Can\'t convert weight to target unit.'=>'Das Gewicht kann nicht in die Zieleinheit umgerechnet werden.','Multicurrency is supported by %1$sFlexible Shipping FedEx PRO →%2$s'=>'Mehrere Währungen we