d FedEx API connection. %1$sLearn more →%2$s'=>'Dynamisch berechnete FedEx Live-Tarife auf der Grundlage der hergestellten FedEx API-Verbindung. %1$sMehr erfahren →%2$s','The maximum package weight has been exceeded. Maximum package weight is: %1$s %2$s.'=>'Das maximale Paketgewicht wurde überschritten. Maximales Paketgewicht ist: %1$s %2$s.','Disabled'=>'Deaktiviert','Emergency'=>'Notfall','Alert'=>'Alarm','Critical'=>'Kritisch','Error'=>'Fehler','Warning'=>'Warnung','Notice'=>'Hinweis','Info'=>'Info','Debug'=>'Debug','Can not enable WP Desk Debug log! Cannot create directory %s or this directory is not writeable!'=>'WP Desk Debug-Log kann nicht aktiviert werden! Verzeichnis %s kann nicht erstellt werden, oder dieses Verzeichnis kann nicht geschrieben werden!','Can not enable WP Desk Debug log! Cannot create file %s!'=>'WP Desk Debug-Log kann nicht aktiviert werden! %s Datei kann nicht erstellt werden!','%1$sPlease add now the %2$s shipping method within the shipping zone you want it to be available in →%3$s'=>'%1$sFüge jetzt die %2$s Versandmethode innerhalb der Versandzone hinzu, in der sie verfügbar sein soll →%3$s','API Connection Status'=>'Status der API-Verbindung','Checking...'=>'Wird geprüft…','If you encounter any problems with establishing the API connection, the detailed information on its cause will be displayed here.'=>'Sollten Probleme beim Aufbau der API-Verbindung auftreten, werden hier detaillierte Informationen über die Ursache angezeigt.','OK'=>'OK','Not found HTML view for custom field %1$s.'=>'HTML-Ansicht für benutzerdefiniertes Feld %1$s nicht gefunden.','None'=>'Keine','Fixed value'=>'Festwert','Percentage'=>'Prozentsatz','Use this option to apply the handling fees to the rates. You can use either fixed or percentage values, including the negative ones for discounts.'=>'Verwende diese Option, um die Bearbeitungsgebühren auf die Tarife anzuwenden. Du kannst entweder feste oder prozentuale Werte verwenden, einschließlich der negativen Werte fü