!'=>'Keine Aufschläge auf die Standardtarife!','Fallback'=>'Fallback','Enable fallback'=>'Fallback einschalten','Enable to offer flat rate cost for shipping so that the user can still checkout, if API for some reason returns no matching rates.'=>'Aktiviere das Angebot von Pauschalpreisen für den Versand, damit der Benutzer immer noch zur Kasse gehen kann, wenn die API aus irgendeinem Grund keine passenden Preise liefert.','Fallback Cost'=>'Fallback-Kosten','We noticed that you are using the Germanized plugin along with %1$s. In order to display the accurate rates, please select the WooCommerce default option in the Germanized Taxes > Additional Costs > Tax calculation mode settings. %2$sNeed assistance? Get in touch →%3$s'=>'Wir haben festgestellt, dass du das Germanized Plugin zusammen mit %1$s verwendest. Um die korrekten Tarife anzuzeigen, wähle die WooCommerce Standard in den Germanized Einstellungen Steuern > Nebenkosten > Steuerberechnung. %2$sBrauchst du Hilfe? Nimm Kontakt auf →%3$s','Show %1$s'=>'Anzeigen %1$s','Hide %1$s'=>'Ausblenden %1$s','Copy %1$s to clipboard'=>'Kopieren %1$s in die Zwischenablage','(Delivery Days: 0 days)'=>'(Liefertage: 0 Tage)','(Delivery Days: %1$d day)'=>'(Liefertage: %1$d Tag)' . "\0" . '','(Delivery Date: %1$s)'=>'(Lieferdatum: %1$s)','Awesome, you\'ve been using %s for more than 2 weeks. Could you please do me a BIG favor and give it a 5-star rating on WordPress? ~ Peter'=>'Toll, du hast %s schon seit mehr als 2 Wochen benutzt. Könntest du mir bitte einen GROSSEN Gefallen tun und ihm eine 5-Sterne-Bewertung auf WordPress geben? ~ Peter','%1$sOk, you deserved it%2$s'=>'%1$s Ok, du hast es verdient %2$s','%1$sNope, maybe later%2$s'=>'%1$s Nein, vielleicht später%2$s','%1$sI already did%2$s'=>'%1$sSchon getan%2$s','Created with %1$s by %2$s - If you like %3$s you can %4$srate us %5$s in plugins repository &rarr;%6$s'=>'Erstellt mit %1$s von %2$s - Hat es dir %3$s gefallen, könntest du uns %4$s%5$s in plugins Repository bewerten &