n dennoch ganz normal funktionieren.','Allow & Continue &rarr;'=>'Zulassen & Weiter &rarr;','Skip'=>'Überspringen','What permissions are being granted?'=>'Welche Berechtigungen werden erteilt?','Your Site Overview'=>'Deine Website-Übersicht','WP version, PHP info'=>'WP Version, PHP Info','Plugin Usage'=>'Plugin Nutzung','Current settings and usage information of %1$s plugins'=>'Aktuelle Einstellungen und Nutzungsinformationen von %1$s Plugins','Your Store Overview'=>'Überblick über deinen Shop','Anonymized and non-sensitive store usage information'=>'Anonymisierte und nicht sensible Speichernutzungsinformationen','Find out more &raquo;'=>'Erfahre mehr &raquo;','Current settings and usage information of WP Desk plugins'=>'Aktuelle Einstellungen und Nutzungsinformationen von WP Desk Plugins',' If you have a moment, please let us know why you are deactivating plugin (anonymous feedback):'=>' Wenn du einen Moment Zeit hast, lass uns bitte wissen, warum du das Plugin deaktivierst (anonymes Feedback):','I found a better plugin'=>'Ich habe ein besseres Plugin gefunden','Kindly tell us the reason so we can improve'=>'Nenne bitte den Grund, sodass wir uns stetig verbessern können','We need your help to improve <strong>WP Desk plugins</strong>, so they are more useful for you and the rest of <strong>30,000+ users</strong>. By collecting data on how you use our plugins, you will help us a lot. We will not collect any sensitive data, so you can feel safe.'=>'Wir benötigen Ihre Hilfe, um die <strong>WP-Desk-Plugins</strong> zu verbessern, so dass sie noch nützlicher für dich und den Rest der <strong>30,000+ Benutzer</strong> sind. Indem wir Daten darüber sammeln, wie du unsere Plugins verwendest, hilfst du uns sehr. Wir sorgen dafür, dass keine sensible Daten gesammelt werden.','You successfully opted out of collecting usage data by WP Desk. If you change your mind, you can always opt in later in the plugin\'s quick links.'=>'Du hast erfolgreich angegeben, dass du keine Nutzungsdaten mit WP Desk teilen möchtest. Wenn du deine Meinung ändern solltest, könntest du jederzeit über die Quicklinks des Plugins zustimmen.','Upgrade'=>'Upgrade','The &#8220;%s&#8221; plugin cannot run on PHP versions older than %s. Please contact your host and ask them to upgrade.'=>'Das &#8220;%s&#8221; Plugin kann nicht mit PHP-Versionen älter als %s ausgeführt werden. Bitte kontaktiere deinen Hoster und bitte ihn darum, ein Upgrade durchzuführen.','The &#8220;%s&#8221; plugin cannot run on WordPress versions older than %s. Please update WordPress.'=>'Das &#8220;%s&#8221; Plugin kann nicht auf WordPress-Versionen ausgeführt werden, die älter als %s sind. Bitte aktualisiere WordPress.','The &#8220;%s&#8221; plugin cannot run on WooCommerce versions older than %s. Please update WooCommerce.'=>'Das &#8220;%s&#8221; Plugin kann nicht auf WooCommerce-Versionen ausgeführt werden, die älter als %s sind. Bitte aktualisiere WooCommerce.','The &#8220;%s&#8221; plugin cannot run without OpenSSL module version at least %s. Please update OpenSSL module.'=>'Das &#8220;%s&#8221; Plugin kann nicht ohne mindestens %s OpenSSL-Modulversion ausgeführt werden. Bitte aktualisiere das OpenSSL-Modul.','The &#8220;%1$s&#8221; plugin requires at least %2$s version of %3$s to work correctly. Please update it to its latest release.'=>'Das Plugin &#8220;%1$s&#8221; benötigt mindestens %2$s Version von %3$s, um korrekt zu funktionieren. Bitte aktualisiere es auf die neueste Version.','The &#8220;%s&#8221; plugin cannot run without %s active. Please install and activate %s plugin.'=>'Das &#8220;%s&#8221; Plugin kann nicht ohne aktives %s ausgeführt werden. Bitte installiere und aktiviere das %s Plugin.','The &#8220;%s&#8221; plugin requires free %s plugin. <a href="%s">Install %s</a>'=>'Das &#8220;%s&#8221; Plugin erfordert ein kostenloses %s Plugin. <a href="%s">Installiere %s</a>','The &#8220;%s&#8221; plugin requires activating %s plugin. <a href="%s">Activate %s</a>'=>'Das &#8220;%s&#8221; Plugin erfordert die Aktivierung des %s Plugins. <a href="%s">Aktiviere %s</a>','The &#8220;%s&#8221; plugin cannot run without %s PHP module installed. Please contact your host and ask them to install %s.'=>'Das &#8220;%s&#8221; Plugin kann nicht laufen, wenn kein %s PHP-Modul installiert ist. Bitte kontaktiere deinen Hoster und bitte ihn, %s zu installieren.','The &#8220;%s&#8221; plugin cannot run without %s PHP setting set to %s. Please contact your host and ask them to set %s.'=>'Das &#8220;%s&#8221; Plugin kann nicht laufen ohne die %s PHP-Einstellung auf %s zu setzen. Bitte kontaktiere deinen Hoster und bitte ihn, %s zu setzen.','The &#8220;%s&#8221; plugin is temporarily disabled since the required %s plugin is being upgraded.'=>'Das Plugin &#8220;%s&#8221; ist vorübergehend deaktiviert, da das erforderliche %s Plugin gerade aktualisiert wird.','Shipping service should implements CanTestSettings interface! Or overwrite this method'=>'Der Versanddienst sollte die CanTestSettings-Schnittstelle implementieren oder überschreiben Sie diese Methode']];